// Table.tsx
import React from 'react';
import { useAudio } from './audio/AudioContext';

const Table: React.FC = () => {
  const { setCurrentAudioUrl } = useAudio();

  // Пример данных таблицы
  const tableData = [
    { id: 1, name: 'Audio 1', url: 'path/to/audio1.mp3' },
    { id: 2, name: 'Audio 2', url: 'path/to/audio2.mp3' },
    // ...
  ];

  const handleRowClick = (url: string) => {
    setCurrentAudioUrl(url);
  };

  return (
    <table>
      <thead>
        <tr>
          <th>ID</th>
          <th>Name</th>
        </tr>
      </thead>
      <tbody>
        {tableData.map((row) => (
          <tr key={row.id} onClick={() => handleRowClick(row.url)}>
            <td>{row.id}</td>
            <td>{row.name}</td>
          </tr>
        ))}
      </tbody>
    </table>
  );
};

export default Table;
